import React from "react";
function Table(prop){
    const data=prop.data;
    console.log("tabledata"+JSON.stringify(data));
    return(
        <div style={prop.style}>
           <tr key={data.id}>
        <td>{data.name}</td>
        <td>{data.velocityX}</td>
        <td>{data.velocityY}</td>
        <td>{data.velocityZ}</td>
        <td>{data.temperature}</td>
        <td>{data.healthScore}%</td>
        <td>{data.trend}</td>
      </tr>
        </div>
    )
}
export default Table;
